description:
Brinsley Le Poer Trench, &quot;Mysterious Visitors: Unidentified Flying Objects Story&quot; 
 Publisher: Macmillan | ISBN: 0330242520 | edition 1975 | PDF | 175 pages | 7.2 mb

 The UFO Story From biblical chariots of fire to the UFOs of today - a fascinating in-depth study of undentified flying objects and psychic phenomena. Why is the reality of flying saucers such a well-kept secret? Are UFO occupants using the moon? What is the explanation of Angel Hair? Are the young men and women of today's permissive society an alien race? Was an entire British regiment subject to teleportation? Why have astronauts been ordered not to discuss UFO sightings?
